import { Grid } from '@material-ui/core';
import React from 'react'

interface ProjectProps {
    name: string
    description: string
    link: string
}

export default function PortfolioProject(props: ProjectProps) {
    return (
        <Grid container spacing={3}>
            <div className="row">
                <div className="col-sm">
                    <h4 className="card-title">{props.name}</h4>
                    <p>{props.description}</p>
                </div>

                <div className="col-sm">
                    <div className="row">
                        <img src="images/thumnail_dl.png" />
                    </div>
                </div>
            </div>
        </Grid>


    );
}
